import React from 'react'
import { Link } from 'react-router-dom'
import styles from '../../styles/styles'
import { navItems } from '../../static/data'

const Navbar = ({active}) => {
  return (
    <div className={`block 900px:${styles.normalFlex}`}>
        {
            navItems && navItems.map((i,index) => (
                <div className='flex'>
                    <Link to={i.url}
                    className={`${active === index + 1 ? "text-[#17dd1f]" : "text-black 800px:text-[#fff]"} font-[500] text-[17px] px-6 cursor-pointer pb-[20px]`}
                    >
                    {i.title}
                    </Link>
                </div>
            ))
        }
    </div>
  )
}

export default Navbar
